INSERT RequisitoCajaClasificacion (rtsEstado,rtsRequisito,rtsClasificacion,rtsTipoTransaccion,rtsCajaCompensacion,rtsTextoAyuda) VALUES ('OBLIGATORIO',(SELECT reqId FROM requisito WHERE reqDescripcion = 'Copia del documento de identidad'),'TRABAJADOR_DEPENDIENTE','CAMBIO_FECHA_NACIMIENTO_PERSONA_PRESENCIAL',1,'"Tarjeta de identidad para menores de 18 años de edad,cédula de ciudadanía o cédula de extranjería para mayores de 18 años de edad. Se revisa: -No debe tener tachones o enmendaduras -El tipo y número de documento de identidad deben coincidir con el registrado en el formulario de afiliación -Los nombres y apellidos deben corresponder a los registrados en el formulario de afiliación -La fecha de nacimiento debe corresponder a la registrada en el formulario de afiliación"'); 
